import React from 'react';
import styled from 'styled-components';
import Logo from '../header/Logo.js';
import Thumbnail from './Thumbnail.js';

import {
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const MainPageS = styled.div`
  display: flex;
  flex-wrap: wrap;

  width: 100%;
  min-width: 1920px;
  height: 100vh;
  min-height: 900px;
  margin-top: 8%;
  flex-direction: row;
  justify-content: center;
  align-items: center;
`;

const TitleS = styled.div`
  display: flex;
  font-family: 'bitbit';
  vertical-align: bottom;
  align-items:center;
  width : ${(props) => props.width};
  height: 36px;
  cursor: pointer;
  margin-left: ${(props) => props.marginleft};
  text-align: center;
  font-weight: 1;
  font-size: 300%;
  color: ${(props) => props.color};
`;

const UnderLineS = styled.div`
  border-bottom: dashed;
  width: 80%;
  height: 0px;
  margin-top: ${(props) => props.margintop};
`;

const AreaS = styled.div`

`;

const BlockS = styled.input`
  width: ${(props) => props.width || '90%'};
  height: ${(props) => props.height};
  border: 2px solid #bbb;
  box-sizing: border-box;
  border-radius: 6px;
  font-size: 2vh;
  text-align: center;
  margin-top: ${(props) => props.margintop};
  margin-left: ${(props) => props.marginleft};
`;

const ButtonS = styled.button`
  padding:  ${(props) => props.padding || '2% 0px'};
  cursor: pointer;
  width: ${(props) => props.width || '80%'};
  height: ${(props) => props.height};
  border: 2px solid #bbb;
  border-radius: 6px; 
  box-sizing: border-box;
  text-align: center;
  margin-top: ${(props) => props.margintop};
  margin-left: ${(props) => props.marginleft};
  font-size: ${(props) => props.fontsize || '100%'};
  line-height: ${(props) => props.lineheight};
  display: ${(props) => props.display};
`;

const BlankS = styled.div`
  width: ${(props) => props.width};
  height: ${(props) => props.height};
  margin-top: ${(props) => props.margintop};
  margin-left: ${(props) => props.marginleft};
  background: ${(props) => props.background};
  display: ${(props) => props.display};
  justify-content: center;
  flex-direction: ${(props) => props.fd};
  font-size: ${(props) => props.fontsize || '100%'};
  line-height: ${(props) => props.lineheight};
  text-align: ${(props) => props.textalign || 'center'};  
  align-items: center;
  font-family:'bitbit';
`;

const NavButtonS = styled.div`
  cursor: pointer;
  text-align : center;
  width: 10%;
  height: 5%;
  font-size: 16px;
  text-align: center;
  font-family:'bitbit';
  font-weight: 1;
  margin-left: ${(props) => props.marginleft};
  margin-right: ${(props) => props.marginright};
  margin-top: ${(props) => props.margintop};
  color: ${(props) => props.color};
`;

const IconBoxS = styled.img`
  width: ${(props) => props.width};
  height: ${(props) => props.height};
  margin-left: ${(props) => props.marginleft};
  margin-right: ${(props) => props.marginright};
  margin-top: ${(props) => props.margintop};
  border: ${(props) => props.border || '2px solid #bbb'};
  box-sizing: border-box;
`;

function Itemdetail({ children }) {

  return <MainPageS>
      <TitleS>사과그림파는사람</TitleS>
      <BlankS width='100%'></BlankS>
      <UnderLineS margintop='0.9%'></UnderLineS>

      <BlankS width='24%' height='100%' margintop='1vh' background='gray' >
        <BlankS display='flex' width='100%' height='48%' background=''>
          <IconBoxS src='https://cdn-icons-png.flaticon.com/512/4478/4478115.png' width='100%' height='100%'></IconBoxS>
        </BlankS>

        <BlankS display='flex' width='100%' height='8%' margintop='1vh' background='gray'>
          <IconBoxS src='https://cdn-icons-png.flaticon.com/512/4478/4478115.png' width='20%' height='100%'></IconBoxS>
          <IconBoxS src='https://cdn-icons-png.flaticon.com/512/9466/9466852.png' width='20%' height='100%' marginleft='3%'></IconBoxS>
          <IconBoxS src='https://cdn-icons-png.flaticon.com/512/4478/4478450.png' width='20%' height='100%' marginleft='3%'></IconBoxS>
          <IconBoxS width='20%' height='100%' marginleft='3%'></IconBoxS>
          <IconBoxS width='20%' height='100%' marginleft='3%'></IconBoxS>
        </BlankS>

        <BlankS display='flex' width='20%' height='2%' marginleft='2%' margintop='5vh' fontsize='150%' background='' textalign='left'>상품설명</BlankS>
        <BlankS width='96%' height='2%' marginleft='2%' margintop='1.5vh' background='' textalign='left'>
          나는 문어 꿈을 꾸는 문어
          꿈속에서는 무엇이든지 될 수 있어
          나는 문어 잠을 자는 문어
          잠에 드는 순간 여행이 시작되는 거야

          높은 산에 올라가면 나는 초록색 문어
          장미 꽃밭 숨어들면 나는 빨간색 문어
          횡단보도 건너가면 나는 줄무늬 문어
          밤하늘을 날아가면 나는
          오색찬란한 문어가 되는 거

          야 아아아 아아 야 아아아 아아
          깊은 바닷속은 너무 외로워
